#nullable enable // autogenerated

using System;

namespace MVZ2.Scenes
{
    public class MainScenePage : ScenePage
    {
        public override void Hide()
        {
            base.Hide();
            OnReturnClick = null;
        }
        protected void Return()
        {
            OnReturnClick?.Invoke();
            Hide();
        }
        public event Action? OnReturnClick;
    }
}
